webpackJsonp([0x5f19a765c16d],{6481:function(t,e){t.exports={data:{post:{html:"<p>Our <em>Tagesmutter</em> is out of town for a conference, and MamaMaus is covorting on Malta, so I'm home alone with Christopher. Actually, I'm splitting the time so that today I have Christopher and his best friend Janik, while tomorrow they are both at Janik's house. Janik just started first grade, so we pick him up at school at 11:30 (yes, that's the wonderful German half-day school system). Wish me luck on surviving the afternoon! </p>\n<p>Needless to say, attending the <a title=\"Meeting tonight by Heiko Hebig | hebig.com\" href=\"http://www.hebig.com/archives/001664.shtml\">Blogger Treff in Hamburg</a> this evening is out of the question.</p>",fields:{title:"Monster Double Feature",date:"06 Nov 2003",url:"https://papascott.de/2003-11-06-monster-double-feature/"}}},pathContext:{slug:"/2003-11-06-monster-double-feature/",prev:{fields:{title:"brentashley: The Clinton Javascript Bug",date:"05 Nov 2003",slug:"/2003-11-05-brentashley-the-clinton-javascript-bug/"}},next:{fields:{title:"Monsters",date:"06 Nov 2003",slug:"/2003-11-06-monsters/"}}}}}});
